import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <body className="page">
        <header className="header">
          <img
            src="<%=require('../images/logo.svg')%>"
            alt="Место"
            className="header__logo"
          />
        </header>
        <main className="content">
          <section className="profile">
          <div className="profile__profile-avatar">
                <img src="<%=require('../images/Avatar.svg')%>" alt="Кусто" className="profile__avatar" />
            </div>
            <div className="profile__info">
                <h1 className="profile__title"></h1>
                <button type="button" className="profile__button-change"></button>
                <p className="profile__subtitle"></p>
            </div>
            <button type="button" className="profile__button-add"></button>
          </section>
        </main>
      </body>
    </div>
  );
}
export default App;


